import './Sidebar.css'
import Logo from '../../imgs/et-logo.png'

const Sidebar = () => {
    return (
        <div className="Sidebar">
            {/* logo */}
            <div className="logo">
                <img src={Logo} alt="IIT-B Dept of ET" />
                <span>eTutor</span>
            </div>

            {/* menu */}

        </div>
    )
}

export default Sidebar
